teve que fazer cortes na Educação e Saúde..\xa0 No fim de 2016 a Dívida estava em 4,7 trilhões e a Dilma não tinha mais dinheiro no orçamento.. daí as pedaladas .. Bancos públicos pagando contas do Governo.. .\xa0 E como Brasil não tinha como aumentar o orçamento e não tinha mais crédito para emitir mais títulos públicos.. o Brasil deixou de investir.. contratos com o governo federal foram encerrados em todo País.. o Senac, Sesc, SENAI.. que tinha como cliente o governo com programa Pronatec.. viu cancelar os contratos de uma hora para outra.. e assim foi com várias empresas.. o que fez agravar mais ..Bolsa caindo.. demissões em massa.. Tudo pq um governo quis gastar.. gastar.. sem pensar no Futuro.. Ahhh os EUA tem um dívida enorme TBM,...sim.. mas tem muitas reservas.. poder bélico e muita tecnologia implantada.. Rússia estava em crise.. por isso entrou nessa Guerra.. a China está há três anos com o PIB só caindo..tbm gastou demais e está sem crédito interno.. no segmento imobiliário.. e por isso se aliou a Rússia.. comercialmente na Guerra.. e está agravando a Crise da China.. lembra são duas Chinas..a comunista que arrumou esse problema de crédito e uma China capitalista.. que já está sofrendo com a Crise interna e vê uma Nova Guerra a vista.. com um vizinho..\xa0<br><br>Então o Lula voltando quer dobrar a aposta..tirar o teto de gastos.. criado justamente para nenhum governo fazer o que o PT fez no passado e com o STF do lado dele caso ganhe.. ele vai intimidar o congresso com uso de STF.. para derrubar o teto de gastos.. aí.. no início será bom... Penso que não será ruim...como antes.. mas isso é artificial.. Todos os países que fizeram isso se deram mal cedo ou tarde..{Venezuela, Argentina.. etc.. )<br><br>Se o nosso Senado mostrar força em 2023.. caso o Lula ganhe..aí podemos ter esperança que os planos do Lula não vão muito adiante.. quem sabe caiba até um novo impeachment para ele . Pq tem umas coisas acontecendo este ano que se for para uma CPI.. pode sobre até para TSE (eu acho)', 'textOriginal': 'Se vc procurar vai achar um vídeo antigo onde o Lula fala bem da época da ditadura.. pois foi um período de pleno emprego.. Quando ele era metalúrgico. Isso acontecia pq o Governo Militar tomava muito empréstimo e tinha obras por todo o País.. bancadas com dinheiro público e suas empreiteiras., todo esse gasto deixou uma dívida externa enorme.. e passamos anos com inflação descontrolada e o FMI mandando no Pais.. Quando chegou no Poder o Lula fez a mesma receita... No início seguiu a receita do tripé econômico do FHC.. e estabilizou o caixa do Governo.. que (FHC) tinha assumido todas as. Dividas dos Estados.. E nesse período com inflação controlada e mundo viveu um estabilidade econômica.. economias crescendo e o Brasil começou a exportar muitas commodetes.. Com dinheiro em Caixa o Lula fez o mesmo plano econômico do Governo Militar.. muitos gastos públicos (PAC). aumento do funcionalismo.. obras públicas em todo lugar(empreiteiras) e muitas não eram de infraestrutura.. e já no fim do seu segundo mandato.. Para manter todo o gasto do Governo.. o Lula emitia títulos de dívida pública (para não imprimir dinheiro.. vendia títulos para captar dinheiro) Esses títulos eram comprados em sua maioria pelos os Bancos Nacionais (por isso querem o Lula de Volta).. com um cliente pegando empréstimos toda hora.. (pq emitir títulos de dívida em resumo é uma operação de crédito com os Bancos)..\xa0 os Bancos nunca lucraram Tanto.. essa dívida com entidades financeiras é a nossa dívida pública... Que está em 5,7 trilhões..\xa0 Então com essa dívida crescendo em cada orçamento anual.. sobrava menos dinheiro para investir em infraestrutura e manter os gastos em educação e saúde..despesas obrigatórias.. Esquecem que para passar o Governo para Dilma e fechar as contas do governo. O Lula teve que fazer cortes na Educação e Saúde..\xa0 No fim de 2016 a Dívida estava em 4,7 trilhões e a Dilma não tinha mais dinheiro no orçamento.. daí as pedalad